import React from "react";
import { HomeContentContainer } from "./HomeContent.Styles";
import homeImage from "../../Assets/Images/home_image.svg";

export const HomeContent = () => {
  return (
    <HomeContentContainer>
      <div className="title-container">
        <h1>Programação Web</h1>
        <h2>FATEC Mogi das Cruzes</h2>
      </div>

      <div className="home-content">
        <img src={homeImage} alt="imagem da pag home"></img>
        <div className="text-content">
          <h2>Projeto voltado ao desenvolvimento front-end </h2>
          <h2>front-end e back-end, utilizando:</h2>
          <h2>ReactJS SpringBoot MySQL Git</h2>
        </div>
      </div>
    </HomeContentContainer>
  );
};
